import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};
const imgStyle = {
    height: '160px',
    marginRight: '100%'
}
const appStyle = {
  height: '160px',
  marginRight: '100%'
}

const Header = () => (
  <div style={appStyle}>
    <img src="/dkp.png" style={imgStyle}/>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <Link href="/events">
      <a style={linkStyle}>Events</a>
    </Link>
    <Link href="/booking">
      <a style={linkStyle}>Booking</a>
    </Link>
  </div>
);

export default Header;
